CREATE TABLE CrimeCase(
   CrimeID SERIAL PRIMARY KEY NOT NULL,
   City       VARCHAR(30) NOT NULL,
   Street     VARCHAR(40) NOT NULL,
   ZipCode    INTEGER  NOT NULL,
   OccurDate  DATE  NOT NULL,
   OccurTime  TIME NOT NULL,
   Status     VARCHAR(6) NOT NULL,
   StationID   INTEGER  NOT NULL,
   HandlerID   INTEGER  NOT NULL,
   FOREIGN KEY (HandlerID) REFERENCES Handler(HandlerID),
   FOREIGN KEY (StationID) REFERENCES PoliceStation(StationID) 
);
